import {useEffect} from "react"
import "./progress.css"
function ProgressBar() {
   
  return (
    <div id="barcontainer">
      <div className="bar">
        <div className="progress" style={{width:"10%"}}></div>
      </div>
    </div>
  );
}

export default ProgressBar;
